import React, { useState, useEffect, useCallback } from 'react';
import { Routes, Route, Navigate, useNavigate, useLocation } from 'react-router-dom';
import { Box, CircularProgress, Container } from '@mui/material';

// Placeholder for actual pages and components
// We will create these files later
const LoginPage = React.lazy(() => import('./pages/LoginPage'));
const ProfilePage = React.lazy(() => import('./pages/ProfilePage'));
const ProgressPage = React.lazy(() => import('./pages/ProgressPage'));
const WorkoutPage = React.lazy(() => import('./pages/WorkoutPage'));
const Navbar = React.lazy(() => import('./components/Navbar'));

function App() {
  const [auth, setAuth] = useState(null); // Stores { username: 'user', token: 'base64token' }
  const [loading, setLoading] = useState(true);
  const navigate = useNavigate();
  const location = useLocation();

  useEffect(() => {
    const storedAuth = localStorage.getItem('genfitAuth');
    if (storedAuth) {
      try {
        setAuth(JSON.parse(storedAuth));
      } catch (e) {
        localStorage.removeItem('genfitAuth');
      }
    }
    setLoading(false);
  }, []);

  const handleLogin = useCallback((username, password) => {
    // In a real app, you would call the backend to verify credentials.
    // For now, using hardcoded credentials as per requirements.
    // The backend README mentions `john:password123` and `admin:adminpass`
    // We will use 'john' for a regular user for now.
    let user = null;
    if (username === 'john' && password === 'password123') {
      user = { username: 'john', pass: 'password123' };
    } else if (username === 'admin' && password === 'adminpass') {
      user = { username: 'admin', pass: 'adminpass' };
    }

    if (user) {
      const token = btoa(`${user.username}:${user.pass}`);
      const authData = { username: user.username, token }; 
      localStorage.setItem('genfitAuth', JSON.stringify(authData));
      setAuth(authData);
      navigate(location.state?.from?.pathname || '/profile', { replace: true });
    } else {
      // Handle login failure (e.g., show an error message)
      alert('Invalid credentials'); // Simple alert for now
    }
  }, [navigate, location.state]);

  const handleLogout = useCallback(() => {
    localStorage.removeItem('genfitAuth');
    setAuth(null);
    navigate('/login');
  }, [navigate]);

  if (loading) {
    return (
      <Box display="flex" justifyContent="center" alignItems="center" minHeight="100vh">
        <CircularProgress />
      </Box>
    );
  }

  // PrivateRoute equivalent
  const PrivateElement = ({ children }) => {
    if (!auth) {
      return <Navigate to="/login" state={{ from: location }} replace />;
    }
    return children;
  };

  return (
    <React.Suspense fallback={
      <Box display="flex" justifyContent="center" alignItems="center" minHeight="100vh">
        <CircularProgress />
      </Box>
    }>
      {auth && <Navbar onLogout={handleLogout} username={auth.username} />}
      <Container sx={{ mt: 4, mb: 4 }}>
        <Routes>
          <Route path="/login" element={auth ? <Navigate to="/profile" /> : <LoginPage onLogin={handleLogin} />} />
          <Route 
            path="/profile" 
            element={<PrivateElement><ProfilePage /></PrivateElement>} 
          />
          <Route 
            path="/progress" 
            element={<PrivateElement><ProgressPage /></PrivateElement>} 
          />
          <Route 
            path="/workout" 
            element={<PrivateElement><WorkoutPage /></PrivateElement>} 
          />
          <Route path="*" element={<Navigate to={auth ? "/profile" : "/login"} />} />
        </Routes>
      </Container>
    </React.Suspense>
  );
}

export default App;
